import React from "react";
import { Container, Title, Background, SubTitle } from "./styles";

export default function Footer({ title, subtitle }) {
  return (
    <Container>
      <Title>{title}</Title>
      <SubTitle>{subtitle}</SubTitle>
    </Container>
  );
}
